pragma solidity >=0.8.18 <0.9.0;

contract Pointer{
    uint256[] public pointer;
    mapping(uint256 => uint256) public pointerMap;
    constructor() {
        pointer.push(0);
    }
    function new_uint256(uint256 _value) public {
        pointer.push(_value);
        pointerMap[_value] = pointer.length - 1;
    }
    function new_delete(uint256 _point) public {
        uint256 _index = pointerMap[_point];
        uint256 _last = pointer[pointer.length - 1];
        pointer[_index] = _last;
        pointer.pop();
        pointerMap[_last] = _index;
        delete pointerMap[_point];
    }
}

